export default function MainComponent() {
  return (
    <div className="main-container">
      <Navbar />
      {/* <Predict /> */}
      <Router>
        <Routes>
          {/* <Route path="/" element={<MainComponent />}/> */}
            <Route path='/predict' element={<Predict />} />
            <Route path='/livepredict' element={<LivePredict />} />
        </Routes>
      </Router>
    </div>
  );
}
